/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwModelIconService', () => import('js/AwModelIconService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
