            "method": "awModelIconRenderFunction",
            "deps": "js/AwModelIconService",
            "options": {
                "useMemo": true
            }
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "vmo": {
            "type": "viewModelObject"
        },
        "hideoverlay": {
            "type": "string"
        }
    },
    "_viewModelId": "AwModelIcon",
    "_uniqueViewModelId": "AwModelIcon",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awModelIconRenderFunction, {"useMemo":true}, ctxImportObj );

export default Component;
